import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

const Usuario = ({ route }) => {
  const { user } = route.params; // Recebe o objeto de usuário enviado pela navegação

  return (
    <View style={styles.container}>
      <Image
        source={{ uri: user.perfil || 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQkMMAxb6dOJG5OxyqQi0Oas3lh4RTgDhq8pg&s' }}
        style={styles.profileImage}
      />
      <Text style={styles.userName}>{user.nome}</Text>
      <Text style={styles.userUsername}>@{user.username}</Text>

      
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
    padding: 20,
  },
  profileImage: {
    width: 100,
    height: 100,
    borderRadius: 50,
    marginBottom: 20,
  },
  userName: {
    fontSize: 24,
    fontWeight: 'bold',
  },
  userUsername: {
    fontSize: 18,
    color: '#555',
  },
});

export default Usuario;
